				["complete"] = "Merci ! Il semble que mes porte-bonheur vous aient porté chance à vous aussi, $c. Pendant votre absence, je n’ai pas joué à des jeux d’argent et je n’ai donc pas perdu mon chariot.\n\nJe serais heureux de vous le prêter pour vous en servir dans votre voyage. En outre, il me reste des marchandises à reprendre à un certain grumelot véreux !",
