				["what"] = "quest",
				["progress"] = "Je n'aurais de cesse d'avoir rendu son bâton à l'archimage Vargoth. Avez-vous réussi à le tirer des griffes du démon ?",
				["targetkind"] = "npc",
				["targetname"] = "Ravandwyr",
				["complete"] = "Ah, vous avez donc réussi à récupérer le bâton. Impressionnant, $N. Vous êtes peut-être celui que je recherche.\n\nOh oui, votre récompense...\n\n<Ravandwyr vous glisse quelques pièces dans la main.>\n\nJe pense bien que vous vous attendiez à mieux que ça, mais cela aussi viendra en son temps. Pour le moment, dites-vous que votre véritable récompense est une opportunité à saisir.",
