				["complete"] = "Laissez-moi y jeter un coup d'œil.\n\nHmm, je ne vois rien de spécial. Je doute que ce soit le bon, bien que d'après votre description des activités de la Légion ardente dans les ruines, on dirait qu'ils recherchent quelque chose en particulier eux aussi.\n\nEspérons qu'il ne s'agit pas de ce cristal que le prince-nexus désire tant se procurer.",
