				["targetkind"] = "npc",
				["targetname"] = "Chef-de-fusée Karlingue",
				["complete"] = "Oh ! Oh... vous vous êtes occupé de Néantroche. Voilà une bonne nouvelle !\n\nMaintenant que nous nous sommes débarrassés de ce gêneur, ce sera plus facile d'exploi... euh, gérer les ressources de la Désagrégation.\n\nHeureux d'apprendre qu'il n'écrasera plus ces pauvres élémentaires innocents.\n\nComment pourrais-je jamais vous remercier ?",
			}, -- [200]
			{
				["questid"] = 10261,
				["targetid"] = 19645,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "J'espère que vous êtes ici au sujet de mon avis de recherche !",
				["targetkind"] = "npc",
				["targetname"] = "Papa Roulette",
				["complete"] = "You-hou ! Est-ce que vous savez seulement comme c'est difficile de se procurer ces machins ? Ce n'est pas comme si je recevais régulièrement des livraisons de pièces par ici.\n\nVous savez quoi, je voudrais que vous preniez quelque chose dans ma boîte à bric-à-brac en guise de paiement. Je suis sûr que vous trouverez là-dedans quelque chose que vous pouvez utiliser. Et sinon, vous pouvez toujours vendre un de ces objets.\n\nTrès bien, laissez-moi vous décharger de ça et l'installer dans mon analyseur de spectre à long cou avant que le servomoteur défectueux n'explose !",
			}, -- [201]
