				["complete"] = "<Ravandwyr examine attentivement les cristaux, puis en choisit un.>\n\nCe cristal devrait faire l'affaire. Je vais refaçonner la châsse du bâton pour y placer cette nouvelle pièce.\n\nQuand l'archimage Vargoth verra ça, il sera déçu. Mais je peux supporter la déception de mon maître si elle implique que nous ayons réussi à le libérer.",
