			{
				["questid"] = 10226,
				["targetid"] = 19709,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Vous avez récupéré la puissance de ces élémentaires ? Oh, ce n’est pas la peine de vous dépêcher, hein. C’est juste ma vie et ma carrière qui sont en jeu.",
				["targetkind"] = "npc",
				["targetname"] = "Ingénieur en chef Trep",
				["complete"] = "Ah, c’est bien mieux comme ça ! Très bien, maintenant, nous sommes dans la course.\n\nLaissez-moi le temps de déposer ce machin dans le bidulo-magico-truc, et je suis sûr qu’il va nous cracher un noyau de phase totalement fonctionnel pour le moteur.\n\nOh, oui, je pense que je dois vous récompenser pour m’avoir sauvé la peau ! Héhé.",
			}, -- [271]
			{
				["questid"] = 10206,
				["targetid"] = 19645,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Vous avez déjà récupéré leur technologie ? J'espère bien que vous n'êtes pas en train de me faire marcher, $c.\n\nLe succès du projet X-52 dépend de la vitesse à laquelle vous arriverez à tout récupérer !",
				["targetkind"] = "npc",
				["targetname"] = "Papa Roulette",
				["complete"] = "Héhé, imbéciles d'éthériens !\n\nMerci de nous avoir rapporté ces modèles, $c. J'espère qu'on pourra les intégrer directement à la fusée. Je me demande à quoi sert tout ça. On devrait bien s'amuser à le découvrir !\n\nMmm, voyons-voir si je peux trouver un peu de menue monnaie à vous jeter.",
			}, -- [272]
			{
				["questid"] = 10262,
				["targetid"] = 19880,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Est-ce fait ? Avez-vous balayé la vermine Zaxxis de la surface de l'Outreterre ? M'avez-vous ramené leurs insignes ?",
				["targetkind"] = "npc",
				["targetname"] = "Traqueur-du-Néant Khay'ji",
				["complete"] = "Ces insignes sont un bon début.\n\nMalheureusement, pendant que vous étiez au Monceau, l'un de mes autres agents parmi les Zaxxis m'a fait prévenir que l'écumeur-dimensionnel Nesaad est encore en vie !",
			}, -- [273]
			{
				["questid"] = 10209,
				["targetid"] = 19644,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Avez-vous la pierre de Glacius ?",
				["targetkind"] = "npc",
				["targetname"] = "Image de l’archimage Vargoth",
				["complete"] = "<Vous ne savez pas s'il s'agit seulement d'un effet de distorsion ou si l'archimage est réellement en train de sourire.>\n\nMaintenant que j'ai récupéré la dernière de mes possessions, j'ai tout ce dont j'ai besoin pour rompre la magie de Kael'thas. Je vais commencer immédiatement.",
			}, -- [274]
