				["targetname"] = "Traqueur-du-Néant Khay'ji",
				["complete"] = "Quel soulagement de savoir que quelqu'un a enfin réglé son compte à cette vermine. Vous faites du bon travail, $N... est-ce que vous permettez que je vous appelle par votre nom ?\n\nSi vous le voulez bien, j'aurai une autre tâche à vous confier. Une tâche très importante que quelqu'un de votre talent devrait pouvoir accomplir sans peine.",
