				["targetname"] = "Mihrdad",
				["complete"] = "<Mihrdad hoche la tête et examine les résultats du diagnostic.>\n\nVoilà qui est préoccupant. Les dégâts sont bien plus graves que ce que j'aurais cru. Je peux demander des outils à la Foudreflèche pour entamer les réparations, mais ce ne sera guère utile à moins que nous ne sachions ce qui cause ces dégâts sur notre équipement.",
