				["complete"] = "Un choix intéressant, vous ne trouvez pas ? Il vaudrait mieux que leurs propriétés curatives soient miraculeuses. Je fais payer beaucoup d'argent pour une fleur d'aspect tout à fait quelconque.",
			}, -- [347]
			{
				["questid"] = 10433,
				["targetid"] = 20921,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "<Shauly élève la voix pour attirer l'attention des éthériens qui se trouvent dans les parages.>\n\nVous avez des fourrures à me vendre ?",
				["targetkind"] = "npc",
				["targetname"] = "Shauly Pore",
				["complete"] = "<Shauly admire ostensiblement les fourrures.>\n\nElles sont magnifiques, absolument magnifiques ! Je vous les payerai au prix fort ! Combien pour conserver vos services ?",
			}, -- [348]
			{
