			}, -- [349]
			{
				["questid"] = 10234,
				["targetid"] = 19728,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Vous avez les pièces ? La Légion ardente qui s'installe au fur et à mesure sur tous nos emplacements ne nous laisse pas beaucoup de temps.",
				["targetkind"] = "npc",
				["targetname"] = "Mama Roulette",
				["complete"] = "Cela conviendra pour le moment, je suppose. Si seulement on pouvait les faire s'enfuir…\n\nHé, ça me donne une idée !",
			}, -- [350]
			{
				["sharable"] = 1,
