				["what"] = "quest",
				["timer"] = 0,
				["questid"] = 10235,
				["targetname"] = "Mama Roulette",
				["targetkind"] = "npc",
			}, -- [351]
			{
				["questid"] = 10267,
				["targetid"] = 20066,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Avez-vous repris possession de l'équipement topographique que les elfes de sang ont refusé de payer ?",
				["targetkind"] = "npc",
				["targetname"] = "Gahruj",
				["complete"] = "Eh bien, vous me voyez heureux d'apprendre que cet épisode malheureux est maintenant derrière nous. Je n'ai pas souvenir d'avoir vu le Consortium faire des affaires avec des gens aussi rustres et peu fiables.\n\nVous, par contre, semblez d'une fiabilité à toute épreuve, $N. Peut-être pourrais-je vous demander de me rendre encore un petit service ?",
			}, -- [352]
			{
				["questid"] = 10310,
				["targetid"] = 20066,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Gahruj",
				["complete"] = "Voilà une excellente nouvelle, mon ami !\n\nDrijya et vous nous avez rendu un grand service. Maintenant que ce portail dimensionnel est hors d'usage, les démons de la région ne pourront plus obtenir de renforts.\n\nPermettez-moi de vous récompenser d'une façon digne du Consortium.",
