			{
				["questid"] = 10235,
				["targetid"] = 19728,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Vous vous êtes déjà occupé de Griffe-funeste ?",
				["targetkind"] = "npc",
				["targetname"] = "Mama Roulette",
				["complete"] = "Il… euh… il a dit quoi ? ILS VONT S'EN PRENDRE À LA ZONE 52 ?!!\n\nOh, c'est pas bon… pas bon du tout !",
			}, -- [356]
			{
				["questid"] = 10418,
				["targetid"] = 20810,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Mihrdad",
				["complete"] = "La région semble déjà plus dégagée. Les dômes sont assez utiles, mais leur défaut essentiel est la façon dont ils incitent par endroit à une croissance effrénée, ce qui accélère la prolifération et la stature des espèces locales.",
			}, -- [357]
			{
				["questid"] = 10243,
				["targetid"] = 183770,
				["action"] = "turn-in",
