				["questid"] = 10245,
				["targetname"] = "Console de contrôle de B'naar",
				["targetkind"] = "object",
			}, -- [359]
			{
				["questid"] = 10237,
				["targetid"] = 19570,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Chef-de-fusée Karlingue",
				["complete"] = "Hé, vous plaisantez, j'espère ? La Légion ardente nous considère comme responsables de tout ça ?\n\nMais c'est VOUS qui l'avez fait !\n\nAïe, j'ai un mal de tête aussi puissant que cette fusée. D'accord, d'accord, il va falloir s'y prendre autrement.\n\nSi la Légion ardente s'imagine qu'elle va pouvoir venir ici, détruire notre ville et briser mon rêve de voyager à travers le Néant distordu, elle se trompe lourdement.\n\nEt je connais justement le gobelin qui pourra nous aider.",
			}, -- [360]
			{
				["questid"] = 10232,
				["targetid"] = 19645,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Papa Roulette",
				["complete"] = "Bon, c'est une bonne et une mauvaise nouvelle, n'est-ce pas ? On leur a fait mal, mais avec la Légion ardente qui se promène dans tout le Raz-de-Néant - et qui se rapproche de nous, je ne sais pas trop comment ça va tourner.\n\nJ'ai le pressentiment qu'il va falloir changer de régime ici pendant un moment. J'espère que vous pourrez nous aider, $N.",
			}, -- [361]
			{
				["questid"] = 10245,
				["targetid"] = 19467,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Voyons ce que vous nous avez apporté, $N.",
				["targetkind"] = "npc",
				["targetname"] = "Anachorète Karja",
				["complete"] = "Bon travail, $N. Accordez-moi quelques instants pour parcourir votre transcription. Les prêtres vous remercient, $c.",
			}, -- [362]
			{
				["questid"] = 10247,
				["targetid"] = 19832,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Docteur Vomisa, Ph.T.",
				["complete"] = "Ma parole, on dirait que c'est notre jour de chance, jeune homme.\n\nJe viens juste d'achever la construction de ma dernière invention, le Saccageur ferrailleur X6000 !\n\nEt vous allez avoir l'honneur de m'aider à le tester, afin qu'on puisse l'utiliser pour défendre la Zone 52 !",
