				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Protecteur Valemort",
				["complete"] = "<Le protecteur semble consterné.>\n\nJe peux déjà apercevoir la prochaine vague sur l'horizon. Les massacrer est utile dans l'immédiat, mais nous devons prendre des mesures plus permanentes.",
			}, -- [387]
			{
				["questid"] = 10184,
				["targetid"] = 19488,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Protecteur Valemort",
				["complete"] = "<Le protecteur Valemort secoue doucement la tête.>\n\nCe n'est pas ce qu'ils auraient mérité, mais c'est le mieux que l'on puisse faire.",
			}, -- [388]
			{
				["questid"] = 10307,
				["targetid"] = 19488,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Protecteur Valemort",
				["complete"] = "<Le protecteur sourit en entendant le nom de Cohlien.>\n\nVous avez absolument raison au sujet du chapeau. Il le portait en permanence et ne le perdait jamais de vue.\n\nEn quelques occasions, un de ses collègues mages, que je ne nommerai pas, a « emprunté » le chapeau et l'a caché pour lui faire une farce. Inutile de dire que sous la menace d'un éclair de givre de Cohlien, il a vite changé d'avis.\n\nLe petit Cohlien va me manquer. Il savait comment s'y prendre avec les femmes elfes.",
			}, -- [389]
			{
				["questid"] = 10343,
				["targetid"] = 19489,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Avez-vous trouvé des restes de l'arme que Kael'thas a utilisée contre le village ?",
				["targetkind"] = "npc",
				["targetname"] = "Lieutenant-ensorceleur Morran",
				["complete"] = "Une bombe de mana ?\n\n<Morran fait tourner le fragment entre ses doigts.>\n\nC'est quasiment impensable ! Même les esprits les plus brillants de Dalaran n'auraient jamais pu concevoir une telle arme. La puissance même de la perturbation engendrée a dû créer une déchirure dans le Néant, et ouvrir à ces créatures un accès vers nos terres.",
			}, -- [390]
