				["complete"] = "<Vous sortez la clochette de votre sac et la faites tinter avant de la montrer à Marguerite, qui semble la reconnaître. La vache vous laisse lui passer le collier de la cloche au cou et vous regarde, attendant visiblement quelque chose de vous.>",
