				["targetkind"] = "npc",
				["targetname"] = "Apprenti Andrethan",
				["complete"] = "Maître Rhonsus m'a appris tout ce que je sais de mon métier. J'honorerai sa mémoire en mettant mes compétences au service du peuple de Kirin'Var.",
			}, -- [406]
			{
