				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Thadell",
				["complete"] = "Marguerite, c'est bien toi ?\n\n<Le fermier se tourne vers vous.>\n\nMerci de m'avoir ramené ma Marguerite, $N. Je ne pourrais pas vivre sans elle !",
