				["targetkind"] = "npc",
				["targetname"] = "Protecteur Valemort",
				["complete"] = "Ce que vous avez fait aujourd'hui ne nous rendra jamais nos disparus, mais cela apaisera peut-être leurs esprits. Même si à dire vrai, nulle quantité de sang ne pourra étouffer ma colère face aux actes de Kael'thas.",
			}, -- [408]
