				["targetkind"] = "npc",
				["targetname"] = "Protecteur Valemort",
				["complete"] = "<Le protecteur Valemort accepte le registre que vous lui tendez et le feuillette.>\n\nHmm...\n\nOn dirait que j'avais raison. Il y a une constante.\n\nLes fantômes les plus agressifs et dangereux correspondent aux membres du Kirin Tor les plus puissants et de plus haut rang qui habitaient au village. Les villageois et les marchands semblent oubliés en comparaison. Qu'est-ce que cela signifie ?",
			}, -- [409]
