				["targetid"] = 19489,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Lieutenant-ensorceleur Morran",
				["complete"] = "<Le lieutenant-ensorceleur Morran hoche la tête d'un air sinistre.>\n\nLe Kirin Tor n'apprécie guère la destruction, mais nous n'avons aucun scrupule à prendre des mesures contre nos ennemis, même dans la mort.",
