				["targetid"] = 19488,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Qu'avez-vous découvert, $N ?",
				["targetkind"] = "npc",
				["targetname"] = "Protecteur Valemort",
				["complete"] = "<Le protecteur Valemort examine les restes.>\n\nL'objet que vous décrivez ressemble à un focalisateur nécromantique... J'aurais dû deviner que ce bon à rien d'apprenti s'abaisserait jusque-là. Je pensais que sa formation ne lui permettrait pas d'aller si loin, mais on dirait bien qu'il m'a donné tort.",
