			{
				["questid"] = 10223,
				["targetid"] = 19488,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Protecteur Valemort",
				["complete"] = "<Vous n'en êtes pas sûr, mais le protecteur Valemort semble être au bord des larmes.>\n\nEnfin, tout est fini. Si je pouvais me faire oublier de cette vie par la simple force de ma volonté, je le ferais, mais en vérité je ne sais pas comment lâcher prise. Pour les habitants du village, c'est une voie clairement tracée mais difficile à emprunter. J'imagine que c'est le prix à payer pour ceux qui gardent des liens aussi forts avec cet endroit.",
			}, -- [438]
			{
				["questid"] = 10239,
				["targetid"] = 19489,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Avez-vous pu leur prendre des sources d'énergie ?",
				["targetkind"] = "npc",
				["targetname"] = "Lieutenant-ensorceleur Morran",
				["complete"] = "<Morran manipule l'un des conteneurs d'un air hésitant.>\n\nJe ne pense pas avoir jamais vu un tel objet. Il contient manifestement beaucoup d'énergie en suspension, mais sous une forme brute. Il faudra procéder avec attention, mais je crois que nous pourrons en tirer un moyen de tenir les créatures de mana éloignées.",
			}, -- [439]
