				["what"] = "quest",
				["progress"] = "Vous découvrez une ouverture grâce à laquelle le carburant est versé dans le saccageur gangrené.",
				["targetkind"] = "npc",
				["targetname"] = "Saccageur gangrené inactif",
				["complete"] = "Le moteur du saccageur gangrené commence à hoqueter et à cracher… Vous n’avez pas versé le bon carburant.",
			}, -- [490]
			{
				["questid"] = 10429,
				["targetid"] = 20871,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Avez-vous l'échantillon de l'hydre monstrueuse ?",
				["targetkind"] = "npc",
				["targetname"] = "Aurine Braselune",
				["complete"] = "<Aurine accepte le cœur.>\n\nMême pour une créature de cette taille, ce cœur est beaucoup trop gros. Il luttait pour réussir à soutenir le corps gigantesque de la créature. J'ai peu de doutes sur le fait qu'elle serait morte avant d'avoir atteint la moitié de son espérance de vie normale.\n\nMême avec tous les risques que ça présente, je suis déterminée à convaincre le Consortium de partager leur technologie. Le projet est trop prometteur pour que j'abandonne maintenant.",
			}, -- [491]
			{
				["questid"] = 10424,
				["targetid"] = 20811,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Avez-vous les diagnostics ?",
				["targetkind"] = "npc",
				["targetname"] = "Ghabar",
				["complete"] = "Ces résultats correspondent exactement à ceux de Mihrdad, mais pourquoi ? Selon moi, la seule explication possible serait qu'une partie de l'équipement du générateur du dôme est en panne ou bien ne s'y trouve plus. Cela affaiblirait significativement les dômes et détruirait leur équilibre comme l'indiquent les diagnostics.",
			}, -- [492]
			{
				["sharable"] = 0,
				["targetid"] = 20811,
				["action"] = "accept",
				["what"] = "quest",
				["timer"] = 0,
				["questid"] = 10430,
				["targetname"] = "Ghabar",
				["targetkind"] = "npc",
			}, -- [493]
			{
				["questid"] = 10855,
				["targetid"] = 20471,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Traqueur-du-Néant Nauthis",
				["complete"] = "Excellentes nouvelles, $N. Maintenant que nous savons quoi faire, je peux engager des sbires pour saboter les saccageurs qui restent.",
			}, -- [494]
			{
				["questid"] = 10336,
				["targetid"] = 20471,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["targetkind"] = "npc",
				["targetname"] = "Traqueur-du-Néant Nauthis",
				["complete"] = "Excellent travail.\n\nMaintenant que les démons de Culuthas sont morts, Zephyrion pourra conduire son équipe de fouilles dans les ruines de Farahlon en toute sécurité.\n\nAcceptez cet argent en témoignage de ma gratitude.",
			}, -- [495]
			{
				["questid"] = 10335,
				["targetid"] = 20470,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "C'était rapide. Vous devez être remarquablement efficace, sans quoi vous n'auriez pas déjà placé ces trois marqueurs.",
				["targetkind"] = "npc",
				["targetname"] = "Zéphyrion",
				["complete"] = "Vraiment ? Vous ne dites pas ça pour vous payer ma bandelette ? C'est une nouvelle fantastique !\n\nMaintenant que le travail de préparation de base est terminé, je vais pouvoir faire monter mon équipe dans les ruines et voir ce que nous pouvons y trouver.\n\nJe vous en remercie, $c.",
			}, -- [496]
			{
				["questid"] = 10435,
				["targetid"] = 20205,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Avez-vous tout réuni ?",
				["targetkind"] = "npc",
				["targetname"] = "Audi la Pointe",
				["complete"] = "Excellent travail ! La partie la plus difficile du projet est terminée. Maintenant, nous n'avons plus qu'à trouver un moyen de les rapporter à la Zone 52 et attirer l'intérêt de l'Expédition cénarienne. Il devrait y en avoir assez pour nos propres besoins plus de quoi faire un petit profit.",
			}, -- [497]
			{
				["questid"] = 10290,
				["targetid"] = 20067,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Je sais bien que les dangers de la collecte de farahlite sont considérables, mais on peut en dire autant des opportunités. Un marchand qui n'est pas prêt à prendre de tels risques peut tout aussi bien fermer boutique.",
				["targetkind"] = "npc",
				["targetname"] = "Zuben Elgenubi",
				["complete"] = "Ah, oui. C'est précisément la qualité que j'espérais. Nous arrêterons peut-être totalement l'exploitation des formations de cristaux si nous pouvons nous approvisionner auprès des géants.",
