				["questid"] = 10280,
				["targetname"] = "A’dal",
				["complete"] = "Vous avez retrouvé le Chant de l'Esprit ! Il s'agit du cristal d'Ata'mal que le prophète Velen laissa à la garde de son peuple quand il partit accomplir sa funeste mission sur l'Exodar.\n\nIl est étrange qu'il n'ait pas eu de vision de son passage entre les mains de la Légion ardente, même s'il fut bref.\n\nOu peut-être l'avait-il vu ? Se peut-il qu'il ait prévu tout cela, et qu'il l'ait laissé arriver pour que vous puissiez récupérer le cristal et me le remettre ici ?\n\nJe sens qu'il s'agit de la vérité. Vous êtes un grand héros pour notre peuple, $N !",
