				["complete"] = "Maintenant, vous savez pourquoi on l'appelle le désert des Dragons. Les os des bêtes jonchent le sol aussi loin que porte le regard.\n\nNous avons probablement abattu une douzaine, peut-être plus, de wyrms de givre et nous n'en voyons pas le bout. Le Fléau a de l'énergie pour en créer dix mille de plus avec tous les os qu'il ya ici.\n\n<Tyralion séclaircit la gorge.>\n\nJe ne veux pas vous ennuyer avec des détails, héros. Nous avons le wyrm que vous cherchez dans nos viseurs.",
