			{
				["targetkind"] = "npc",
				["targetid"] = 27857,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "<Yorik pousse un soupir de soulagement.>\n\nNous pensions que vous ne viendriez peut-être pas, $N.",
				["questid"] = 12472,
				["targetname"] = "Commandant de la Légion Yorik",
				["complete"] = "Quand vous serez prêt, je placerai le phylactère dehors en face du portail et j'invoquerai Thel'zan.",
			}, -- [15]
			{
				["flags"] = 1024,
				["dd"] = 0,
				["action"] = "Killing",
