			{
				["targetkind"] = "npc",
				["targetid"] = 27136,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["questid"] = 12473,
				["targetname"] = "Haut-commandant Halford Verroctone",
				["complete"] = "Grâce à vous, $N, Garde-Hiver est sauvé. Penser qu'un seul homme puisse renverser ainsi le cours d'une bataille est difficile à comprendre pour la plupart des gens ; cependant, nous sommes victorieux ! Vous avez réussi à restaurer la foi de ces gens et gagné le respect de votre commandement.\n\n<Halford vous salue.> \n\nLe seigneur Fordragon est retourné à Angrathar pour préparer nos forces à la destruction du portail du Courroux. Il a demandé que vous le rejoigniez ! Je ne saurais recommander un meilleur soldat pour ce travail, $N.",
			}, -- [17]
			{
				["targetkind"] = "npc",
				["targetid"] = 27872,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["questid"] = 12474,
				["targetname"] = "Généralissime Bolvar Fordragon",
				["complete"] = "Cette décoration est seulement remise à ceux qui sont allés au-delà de l'appel du devoir au nom de l'Alliance. Je pourrais compter le nombre de fois que je l'ai remise sur les doigts d'une main, $N, et jamais personne ne l'a méritée autant que vous ! Félicitations !\n\nMaintenant, examinons le portail du Courroux. N'a-t-il pas l'air familier ? Car il devrait. Cet étrange métal que vous avez trouvé à la mine de Garde-Hiver est exactement la même matière dont est composé le portail du Courroux. Nous devons découvrir ses faiblesses et les rendre publiques ! Mais tout d'abord...",
			}, -- [18]
			{
				["targetkind"] = "npc",
				["targetid"] = 26917,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["questid"] = 12495,
				["targetname"] = "Alexstrasza la Lieuse-de-vie",
				["complete"] = "Vous êtes venu me demander conseil, mortel. Cela je le sais, mais vous, savez-vous vraiment ce que vous affrontez ?\n\n<Alexstrasza pointe vers le nord.>\n\nAu nord d'ici se trouvent les terres où trépassa Galakrond, géniteur des draconidés. C'est à partir de Galakrond que les titans ont créé les Aspects. Alors imaginez la puissance de Galakrond. Sa taille seule est supérieure à tous les Aspects combinés ! Maintenant, essayez de comprendre ce que fait le Fléau à la grande Désolation des dragons.\n\nLes wyrms de givre, mortel, devraient être le dernier de vos soucis.",
			}, -- [19]
			{
				["targetkind"] = "npc",
				["targetid"] = 26949,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "",
				["questid"] = 12497,
				["targetname"] = "Torastrasza",
				["complete"] = "La bravoure des mortels ne manque jamais de m'étonner. La mort vous fixe de son regard glacial et vous, vous lui retournez son regard avec défi ! C'est pour cette raison que votre race est tant aimée... et tant détestée.\n\nBien que le Vol rouge soit totalement investi dans une guerre avec Malygos, il y a quelque chose que nous pouvons faire pour vous aider.",
			}, -- [20]
			{
				["dl"] = 0,
				["action"] = "Opening",
				["zone"] = "Désolation des dragons",
				["id"] = 190354,
				["mapAreaID"] = 488,
