				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Détruisez le Fléau au Repos de Galakrond avant qu'il ne soit trop tard !",
				["questid"] = 12498,
				["targetname"] = "Alexstrasza la Lieuse-de-vie",
				["complete"] = "Je savais que vous reviendriez, $N. Vous avez bien servi l'Accord du Repos du ver et sauvé notre peuple d'une mort certaine. Que ce haut fait soit connu et enregistré pour la postérité !",
			}, -- [22]
