			{
				["targetkind"] = "npc",
				["targetid"] = 63721,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Une pieuvre qui peut se camoufler ?",
				["questid"] = 31446,
				["targetname"] = "Nat Pagle",
				["complete"] = "C’est une pieuvre caméléon ? Un de mes copains en avait pêchée une au large de Zandalar il y a quelques années. Il a failli ne pas en revenir vivant, d’ailleurs. Ces trolls sont d’un mesquin… mais ils ont de bons coins à pêche !\n\nBref. Elles ne sont pas si rares qu’on le croit, c’est juste qu’elles se camouflent dans les rochers et les plantes. Il n’y a que les meilleurs pêcheurs qui peuvent espérer attraper cette bête insaisissable... et délicieuse.",
			}, -- [3]
			{
				["targetkind"] = "npc",
				["targetid"] = 63721,
				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Un poisson volant ?",
				["questid"] = 31443,
				["targetname"] = "Nat Pagle",
				["complete"] = "C’est un gourami tigre volant que vous avez ?\n\nC’est une rare mutation du gourami tigre, capable de voler et donc présente dans toutes les étendues d’eau douce de Pandarie.\n\nLes légendes locales racontent qu’il porte chance à ceux qui le mangent, et d’après les traditions, seuls les gens de sang royal ont le droit d’en consommer. Se faire prendre à violer cette tradition est puni de mort.\n\nJe vais donc m’assurer qu’il arrive entre les bonnes mains.",
			}, -- [4]
