				["action"] = "turn-in",
				["what"] = "quest",
				["progress"] = "Qu’avez-vous découvert jusqu’à présent ?\n\nNous devons rassembler autant d’informations que possible !",
				["targetkind"] = "npc",
				["targetname"] = "Irion",
				["complete"] = "Grâce à votre travail, $N, nous avons pu rassembler un récit ancien. Les mogu étaient autrefois des créatures de pierre, exécutant la volonté des titans. Mais ensuite, leurs maîtres se sont tus et les mogu ont succombé à la malédiction de la chair. Puis vint Lei Shen, qui emprisonna le gardien Ra et lui vola son pouvoir. Ah, quel empire il construisit alors !\n\nMaintenant que nous possédons ce savoir, il est temps d’agir.",
