				["targetkind"] = "npc",
				["targetname"] = "Irion",
				["complete"] = "<Irion presse le cœur sombre dans sa main, ses yeux brûlant avec ardeur.>\n\nVous avez réussi… vous avez réussi ! Le cœur noir du roi-tonnerre !",
