				["targetkind"] = "npc",
				["targetname"] = "Irion",
				["complete"] = "Vous voilà ! Combien de temps ai-je attendu ?\n\n<Irion semble momentanément confus.>\n\nJ’ai l’impression que je viens d’arriver… mais je suis peut-être ici depuis des semaines… Cette île joue des tours à votre esprit.\n\nKairoz a tenté de me l’expliquer, mais parfois j’ai l’impression que les dragons de bronze ne s’expriment que par énigmes.",
